import { Button, HStack, Input } from "@chakra-ui/react";
import React from "react";
function TodoList() {
  function handleSubmit() {}
  return (
    <>
      <form onSubmit={handleSubmit}>
        <HStack mt="8">
          <Input variation="filled" placeholder="Ex: Eat Breakfast" />
          <Button type="submit" colorScheme="cyan" px="8">
            Add Todo
          </Button>
        </HStack>
      </form>
    </>
  );
  return (
    <>
      <VStack
        divider={<StackDivider />}
        borderWidth="2px"
        borderColor="gray.100"
        borderRadius="lg"
        padding="4"
        width="100%"
        maxW={{ base: "90vw", sm: "90vw", lg: "50vw", xl: "40vw" }}
        alignItems={"stretch"}
      ></VStack>
    </>
  );
}

export default TodoList;
